import React from 'react';
import './widgets.css'

class progressBar extends React.Component{
    render(){
        return(
            <div class="header">
  <h2>Scroll Indicator</h2>
  <div class="progress-container">
    <div class="progress-bar" id="myBar"></div>
  </div> 
</div>
        );
    }
}

export default progressBar;
